import base64

def encode(pswd):
    code = base64.b64encode(pswd.encode('utf-8'))
    return code

def decode(data):
    pswd = base64.b64decode(data).decode('utf-8')
    return pswd

pswd = ""


for i in range(1000):
    try:
        pswd = decode(pswd)
    except:
        break
    print(pswd)

  